};

const inner = {
    display:"inline-block",
    verticalAlign: "top",
}

const right1 = {
    color: "darkblue",
    fontSize: "24px",
    textDecoration: "none",
}

const Footer = () => {
    return (
        <div style={style}>
            <div style={inner}>
                <p style={right1}>Top</p>
            </div>
            <div style={inner}>
                <p style={right1}>Search</p>
            </div>
            <div style={inner}>
                <p style={right1}>SNS</p>
            </div>
        </div>
    )
}

export default Footer;
